import math
import string

class BinPackingEasy:
    def minBins(self, item):
        item = list(item)
        currentB = 0
        
        while len(item) > 0:
            first = item.pop()
            candi = []
            for it in item:
                if 300 - first >= it:
                    candi.append(it)
            if len(candi) > 0:
                item.remove(max(candi))
            currentB += 1

        return currentB

